svg.script:


function onMouseOverLabel_compare_compare(evt) { 
    var Line_compare_compare = document.getElementById(evt.target.id.replace("Label_compare_compare", "Line_compare_compare")); 
    Line_compare_compare.setAttribute("style", "fill:none;stroke:black;stroke-width:3"); 
    evt.target.setAttribute("font-size", 17); 
} 
function onMouseOutLabel_compare_compare(evt) { 
    var Line_compare_compare = document.getElementById(evt.target.id.replace("Label_compare_compare", "Line_compare_compare")); 
    Line_compare_compare.setAttribute("style", "fill:none;stroke:black;stroke-width:1"); 
    evt.target.setAttribute("font-size", 15); 
} 
function onMouseOverLine_compare_compare(evt) { 
    var Label_compare_compare = document.getElementById(evt.target.id.replace("Line_compare_compare", "Label_compare_compare")); 
    evt.target.setAttribute("style", "fill:none;stroke:black;stroke-width:3"); 
    Label_compare_compare.setAttribute("font-size", 17); 
} 
function onMouseOutLine_compare_compare(evt) { 
    var Label_compare_compare = document.getElementById(evt.target.id.replace("Line_compare_compare", "Label_compare_compare")); 
    evt.target.setAttribute("style", "fill:none;stroke:black;stroke-width:1"); 
    Label_compare_compare.setAttribute("font-size", 15); 
}
